import React from "react";
import "../Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img
          className="home__image"
          src="https://images-eu.ssl-images-amazon.com/images/G/02/digital/video/merch2016/Hero/Covid19/Generic/GWBleedingHero_ENG_COVIDUPDATE__XSite_1500x600_PV_en-GB._CB428684220_.jpg"
          alt=""
        />
        <div className="home__row">
            <Product 
               title="The Lean Startup: How Constant Innovation Creates Radically Successful Businesses" 
               price={29.9} 
               image="https://images-eu.ssl-images-amazon.com/images/I/51CTIr1bJxL._SY264_BO1,204,203,200_QL40_FMwebp_.jpg"
               rating={5}/>
            <Product
              title="Wonderchef Nutri Blend Complete Kitchen Machine, 22000 RPM Mixer Grinder, Blender, Chopper, Juicer, Stainless Steel Blades, 4 Unbreakable Jars, 2 Years Warranty, 400-Watt, Red, Online Recipe Book By Chef Sanjeev Kapoor"
              price={3399.00}
              image="https://images-na.ssl-images-amazon.com/images/I/61s96dVkxgL._SL1000_.jpg"
              rating={4}/>
        </div>
        <div className="home__row">
            <Product
            id='1234'
            title="Envias Leatherette Latest Handbags For Women's Ladies Combo Of 4 (BabyPink_PrintStrip_EVS-118)"
            price={586.00}
              image="https://images-na.ssl-images-amazon.com/images/I/414QL%2BHOL-L.jpg"
              rating={4}/>
            <Product
                        title="Amazon Brand - House & Shields"
            price={595.00}
              image="https://images-na.ssl-images-amazon.com/images/G/31/Symbol/brandtile/HS_ND._CB483179925_.jpg"
              rating={4}/>
            <Product
                        title="TIMEX Analog Blue Men Watch TW00ZR262E"
            price={1095.00}
              image="https://images-na.ssl-images-amazon.com/images/I/71Kx6rgmlRS._UX522_.jpg"
              rating={4}/>
        </div>
        <div className="home__row">
            <Product
              title="HP Pavilion Gaming 10th Gen Intel Core i5 Processor 16.1 (40.9 cms) FHD Gaming Laptop (8GB/1TB HDD + 256GB SSD/Windows 10/MS Office/NVIDIA GTX 1650 4GB/Shadow Black), 16-a0022TX"
              price={80994.00}
              image="https://images-eu.ssl-images-amazon.com/images/G/31/img21/CEPC/Clearance/May21/D23947948_IN_CEPC_Clearance-store_May21_rush_1500x300.jpg" />
        </div>
      </div>
    </div>
    );
};

export default Home;
